class Login extends React.Component {
    constructor(props) {
        this.state = {
            username: ''
        }
    }
    render() {
        return (
        <div>
            <h1>Login Here</h1>
            <form>
                <input type="text" value={this.state.username}></input>
            </form>
        </div>
        )
    }

}

export default Login;
